import{Buildable}from"../../interface/buildable.min.js";import{OperatingSystemHelpModel}from"../../model/help/operating-system-help-model.min.js";import{Utility}from"../../shared/utility.min.js";import{PageColorAdjuster}from"../../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";import StylesheetSeriesLoader from"../../shared/stylesheet-series-loader.min.js";class OsHelpController extends Buildable{constructor(){super(),this.model=new OperatingSystemHelpModel,this.stylesheetLoader=StylesheetSeriesLoader,this.stylesheetLoader.add("css/work-experience.min.css"),this.stylesheetLoader.load(),this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new OsHelpController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=async()=>{const e=this.model.getOperatingSystems();for(let t=0;t<e.length;t++){const s=e[t],r=[];r.push(this.createNoTd(t)),r.push(this.createNameTd(s)),r.push(this.createDescriptionTd(s));const o=`<tr>${r.join("")}</tr>`;$("#help-info tr:last").after(o)}(await PageColorAdjuster.build()).changeBackgroundColor(),$("body").addClass("loaded")};createTd=e=>`<td class='help-info-cell'>${e}</td>`;createNoTd=e=>{const t=e+1;return this.createTd(`<p style='text-align:center;'>${t}</p>`)};createNameTd=e=>this.createTd(`<p class="work-experience-technology-operating-system" style="white-space:nowrap;">${e.name}</p>`);createDescriptionTd=e=>this.createTd(`<p>${e.description}</p>`)}export{OsHelpController};